INSERT INTO `answers` (`id`, `answer`, `response`) VALUES
(5, 'Где взять ссылку на трейд?', 'Авторизуйтесь на сайте стима и перейдите по ссылке https://steamcommunity.com/id/me/tradeoffers/privacy#trade_offer_access_url'),
(6, 'Я забыл указать примечание к оплате, что делать?', 'Сообщите на почту support@easy-money.ru с какого кошелька оплачивали, дату перевода, какой товар хотели купить и ссылку на трейд и мы вручную отправим Вам товар.'),
(7, 'Я случайно отклонил трейд от бота, что делать?', 'Сообщите на почту support@easy-money.ru номер заказа и мы повторно отправим его Вам.'),
(8, 'У меня остались вопросы, как свами связаться?', 'Пишите на нашу почту support@easy-money.ru работаем без выходных с 9:00 до 22:00 по Москве.'),
(9, 'Почему дешево? ', 'Предметы которые мы продаем брученные они на наших аккаунтах!'),
(10, 'Что такое брут?', 'Брут - это взлом чего либо (аккаунт, счёт, ящик) с помощью подбора пароля. '),
(11, 'Еще вопрос?', 'https://vk.com/easy_weapons_ru пиши в лс группы. ');
