(132, 'Случайный | Нож', 'Все коллекции', 'С этого кейса может выпасть случайный нож любой коллекции. ', 1, 6, 1, 'http://easy-weapons.ru/images/case/knife.png', 1099, 1099, 1, 1),
(133, 'Случайное | Дикое пламя', 'Кейс операции «Дикое пламя»', 'Внутри находится один из следующих предметов:\r\nПП-19 Бизон | Океанская глубина,\r\nDual Berettas | Картель,\r\nMAC-10 | Лазурный хищник,\r\nSSG 08 | Necropos,\r\nTec-9 | Джамбия,\r\nUSP-S | Lead Conduit,\r\nFAMAS | Валентность,\r\nFive-SeveN | Триумвират,\r\nGlock-18 | Королевский легион,\r\nMAG-7 | Преторианец,\r\nMP7 | Чертята,\r\nAWP | Элитное снаряжение,\r\nDesert Eagle | Дракон-предводитель,\r\nNova | Скоростной зверь,\r\nAK-47 | Топливный инжектор,\r\nM4A4 | Звездный крейсер\r\nили крайне редкий нож Боуи!', 1, 1, 1, 'http://easy-weapons.ru/images/case/wildfire.png', 99, 99, 2, 0),
(134, 'Случайное | Авангард', 'Оружейный кейс операции «Авангард»', 'Внутри находится один из следующих предметов:\r\nG3SG1 | Мрак,\r\nMAG-7 | Поджигатель,\r\nMP9 | Дротик,\r\nFive-SeveN | Городская опасность,\r\nUMP-45 | Заблуждение,\r\nGlock-18 | Жернов,\r\nM4A1-S | Василиск,\r\nM4A4 | Грифон,\r\nSawed-Off | Разбойник,\r\nP250 | Картель,\r\nSCAR-20 | Кардио,\r\nXM1014 | Спокойствие,\r\nAK-47 | Пустынный повстанец,\r\nP2000 | Дух огня\r\nили необычайно редкий, особый предмет!', 1, 1, 1, 'http://easy-weapons.ru/images/case/avangard.png', 99, 99, 2, 0),
(135, 'Случайное | Chroma', 'Хромированный оружейный кейс', 'Внутри находится один из следующих предметов:\r\nGlock-18 | Захоронение,\r\nM249 | Блокировка,\r\nMP9 | Смертельный яд,\r\nSCAR-20 | Грот,\r\nXM1014 | Ртуть,\r\nDual Berettas | Городской шок,\r\nDesert Eagle | Нага,\r\nMAC-10 | Малахит,\r\nSawed-Off | Безмятежность,\r\nAK-47 | Картель,\r\nM4A4 | 龍王 (Король драконов),\r\nP250 | Покойник,\r\nAWP | Боец,\r\nGalil AR | Щелкунчик\r\nили необычайно редкий, особый предмет!', 1, 1, 1, 'http://easy-weapons.ru/images/case/chroma.png', 99, 99, 2, 0),
