(146, 'Случайно | Winter Offensive', 'Оружейный кейс «Winter Offensive»', 'Внутри находится один из следующих предметов:\r\nGalil AR | Песчаная буря,\r\nFive-SeveN | Ками,\r\nM249 | Магма,\r\nПП-19 Бизон | Синие полутона,\r\nFAMAS | Пульс,\r\nDual Berettas | Причал,\r\nMP9 | Железная роза,\r\nNova | Восходящий череп,\r\nM4A1-S | Страж,\r\nP250 | Роспись,\r\nAWP | Красная линия,\r\nM4A4 | Азимов,\r\nSawed-Off | Кракен\r\nили необычайно редкий, особый предмет!', 1, 1, 1, 'http://easy-weapons.ru/images/case/winter.png', 99, 99, 2, 0),
