(148, 'Случайное | Weapon Case 2', 'Оружейный кейс CS:GO, тираж #2', 'Внутри находится один из следующих предметов:\r\nTec-9 | Синий титан,\r\nM4A1-S | Кровавый тигр,\r\nFAMAS | Гексан,\r\nP250 | Улей,\r\nSCAR-20 | Кровавая паутина,\r\nFive-SeveN | Поверхностная закалка,\r\nMP9 | Гипнотический,\r\nNova | Графит,\r\nDual Berettas | Гемоглобин,\r\nP90 | Хладнокровный,\r\nUSP-S | Сыворотка,\r\nSSG 08 | Кровь в воде\r\nили необычайно редкий, особый предмет!', 1, 1, 1, 'http://easy-weapons.ru/images/case/weapons%202.png', 99, 99, 2, 0),
(149, 'Случайное | Weapon Case 3', 'Оружейный кейс CS:GO, тираж #3', 'Внутри находится один из следующих предметов:\r\nCZ75-Auto | Кровавая паутина,\r\nP2000 | Красные фрагменты,\r\nDual Berettas | Пантера,\r\nUSP-S | Нержавейка,\r\nGlock-18 | Синяя трещина,\r\nCZ75-Auto | Листовая сталь,\r\nTec-9 | Частица титана,\r\nDesert Eagle | Наследие,\r\nFive-SeveN | Медная галактика,\r\nCZ75-Auto | Новая фуксия,\r\nP250 | Цвета прибоя,\r\nCZ75-Auto | Виктория\r\nили необычайно редкий, особый предмет!', 1, 1, 1, 'http://easy-weapons.ru/images/case/weapons%203.png', 99, 99, 2, 0),
(151, 'AK-47 | Вулкан', 'Охотничья коллекция', 'Мощная и надежная штурмовая винтовка АК-47 — одна из самых известных в мире. Наиболее смертельна стрельба короткими и точными очередями. Покрашен вручную на спортивный мотив.', 1, 6, 2, 'https://cdn.csgo.com/item_1499855791_902658099.png', 500, 500, 1, 1),
(152, 'AWP | Азимов', 'Коллекция «Феникс»', 'Печально известная снайперская винтовка AWP — очень опасное и очень эффективное оружие, которое легко узнается по характерному звуку выстрела и жестокому правилу: «один выстрел, один труп». Раскрашено вручную в стиле научной фантастики. Кто угодно может предсказать будущее… но лишь мечтатель претворяет его в жизнь', 1, 6, 3, 'https://cdn.csgo.com/item_360479494_188530139.png', 499, 499, 1, 1),
(153, 'Desert Eagle | Пламя', 'Коллекция «Dust»', 'Дорогой и крайне мощный Desert Eagle — знаковый пистолет, который непросто освоить, хоть он и удивительно точен на дальних дистанциях. Аэрографический рисунок был нанесен прозрачной краской на основное хромовое покрытие.', 1, 6, 1, 'https://cdn.csgo.com/item_310781367_0.png', 499, 499, 1, 1),
(154, '★ Нож-бабочка | Градиент', 'Без колекции', 'Специально разработанный балисонг, широко известный как нож-бабочка. Главной особенностью этого оружия является молниеносное приведение его в боевое состояние при помощи взмаха руки, обнажающего свободно крепящееся лезвие. Как результат, ножи-бабочки запрещены во многих странах. Покрытую хромом основу с помощью баллончика покрасили в полупрозрачные цвета, которые плавно переходят друг в друга. «Это не только оружие, но и предмет обсуждения», — Имоген, начинающий торговец оружием', 1, 6, 1, 'https://cdn.csgo.com/item_520032493_188530139.png', 1499, 1499, 1, 1),
(155, 'AWP | Скоростной зверь', 'Коллекция «Фальшион»', 'Печально известная снайперская винтовка AWP — очень опасное и очень эффективное оружие, которое легко узнается по характерному звуку выстрела и жестокому правилу: «один выстрел, один труп». Нанесено изображение чудовища в ядовитых красках. «Хочешь удивить меня, Бут? Сделай эту пушку чувствительной к ультрафиолету», — Рона Сабри, многообещающий военный', 1, 6, 2, 'https://cdn.csgo.com/item_1012004440_188530139.png', 759, 759, 1, 0),
(156, '★ Нож с лезвием-крюком | Африканская сетка ', 'Без коллекции', 'Наиболее примечательной особенностью ножа-потрошителя является крюк для потрошения на тыльной стороне лезвия. Первоначально применявшийся как вспомогательное средство для свежевания животных, он также эффективен в прорезании волокнистых материалов, таких как веревки, стропы или ремни безопасности. Баллончиком был нанесен рисунок с использованием трафарета из сетки рабицы и обрывков картона. Хищник — он и в Африке хищник', 1, 6, 1, 'https://cdn.csgo.com/item_313007698_188530139.png', 499, 499, 1, 0),
(157, '★ Нож с лезвием-крюком | Градиент', 'Без колекции', 'Наиболее примечательной особенностью ножа-потрошителя является крюк для потрошения на тыльной стороне лезвия. Первоначально применявшийся как вспомогательное средство для свежевания животных, он также эффективен в прорезании волокнистых материалов, таких как веревки, стропы или ремни безопасности. Покрытую хромом основу с помощью баллончика покрасили в полупрозрачные цвета, которые плавно переходят друг в друга. «Это не только оружие, но и предмет обсуждения», — Имоген, начинающий торговец оружием', 1, 6, 1, 'https://cdn.csgo.com/item_312656289_188530139.png', 1599, 1599, 1, 1),
(158, 'StatTrak™ Glock-18 | Водяной', 'Коллекция «Прорыв»', 'Этот предмет использует технологию StatTrak™, которая помогает отслеживать определенные пункты статистики, выполненные владельцем.\r\nЭтот предмет отслеживает количество подтвержденных убийств.\r\nПистолет Glock 18 подходит для первого раунда. Он наиболее эффективен против противников без бронежилета и позволяет вести огонь сериями из трех выстрелов. Рисунок водяного в стиле графики нанесен вручную.\r\n', 2, 5, 2, 'https://cdn.csgo.com/item_520047363_188530144.png', 599, 599, 1, 0),
(159, '★ Складной нож | Doppler', 'Без коллекции', 'Спортивные складные ножи персидского стиля со стреловидным лезвием и очень острой заточкой. В то время как лезвие может быть хрупким, сам складной нож удивительно прочный. Окрашено черной и серебряной металлической краской под мрамор, а затем нанесен градиент. Чрезмерно усердное разглядывание приводит к летальному исходу\r\n', 1, 1, 1, 'https://cdn.csgo.com/item_720544632_188530139.png', 1499, 1499, 1, 0),
(160, '★ Складной нож | Зуб тигра', 'Без коллекции', 'Спортивные складные ножи персидского стиля со стреловидным лезвием и очень острой заточкой. В то время как лезвие может быть хрупким, сам складной нож удивительно прочный. Анодирован в оранжевый цвет, также вручную нанесена гравировка в форме полос тигра. Редкий, словно тигр… Смертельный, словно тигр…', 1, 6, 1, 'https://cdn.csgo.com/item_721036866_188530139.png', 1499, 1499, 1, 0),
(161, '★ Охотничий нож | Кровавая паутина', 'Без коллекции', 'Современный тактический нож, отлично подходящий как для боевых, так и мирных нужд. Уникальная заточка танто позволяет хорошо пробивать даже самые жесткие поверхности. На отдельные части оружия нанесли водостойкую краску красного цвета, черные узоры паутины и слой полуглянца. Внимательно смотри, куда идешь, ведь никогда не знаешь, где можно угодить в паутину', 1, 6, 1, 'https://cdn.csgo.com/item_470085687_188530139.png', 1999, 1999, 1, 0),
(162, '★ Охотничий нож | Градиент', 'Без коллекции', 'Современный тактический нож, отлично подходящий как для боевых, так и мирных нужд. Уникальная заточка танто позволяет хорошо пробивать даже самые жесткие поверхности. Покрытую хромом основу с помощью баллончика покрасили в полупрозрачные цвета, которые плавно переходят друг в друга. «Это не только оружие, но и предмет обсуждения», — Имоген, начинающий торговец оружием', 1, 6, 1, 'https://cdn.csgo.com/item_469455675_188530139.png', 999, 999, 1, 1),
(163, 'M4A1-S | Шедевр', 'Коллекция «Overpass»', 'Бесшумный карабин M4A1 оснащен менее вместительным магазином, чем его аналог без глушителя, зато он обеспечивает более тихую стрельбу с меньшей отдачей и повышенной точностью. Рисунок в виде вызывающего граффити нанесен вручную.', 1, 5, 3, 'https://cdn.csgo.com/item_519991230_302028390.png', 699, 699, 1, 1),
(164, 'M4A4 | Азимов', 'Коллекция «Winter Offensive»', 'M4A4 — более точный, но слабый аналог АК-47 — полностью автоматическая штурмовая винтовка, которая находится исключительно на вооружении у спецназа. Раскрашено вручную в стиле научной фантастики. Кто угодно может предсказать будущее… но лишь мечтатель претворяет его в жизнь', 1, 6, 3, 'https://cdn.csgo.com/item_310777979_188530139.png', 399, 399, 1, 0),
(165, 'AK-47 | Поверхностная закалка', 'Коллекция «Arms Deal»', 'Мощная и надежная штурмовая винтовка АК-47 — одна из самых известных в мире. Наиболее смертельна стрельба короткими и точными очередями. Закалено с использованием древесного угля на высоких температурах. Немного цвета никому не повредит\r\n', 1, 5, 2, 'https://cdn.csgo.com/item_310776790_188530139.png', 449, 449, 1, 0),
(166, '★ Керамбит | Дамасская сталь', 'Без колекции', 'Керамбит — это нож с изогнутым лезвием, имитирующим клык тигра, специально разработанный для юго-восточного азиатского боевого искусства силат. Нож обычно держат обратной хваткой, вдевая указательный палец в кольцо на рукоятке.', 1, 6, 3, 'https://cdn.csgo.com/item_721408081_188530139.png', 999, 999, 1, 0),
(167, '★ Нож-бабочка | Кровавая паутина', 'Скидка только сегодня', 'Специально разработанный балисонг, широко известный как нож-бабочка. Главной особенностью этого оружия является молниеносное приведение его в боевое состояние при помощи взмаха руки, обнажающего свободно крепящееся лезвие. Как результат, ножи-бабочки запрещены во многих странах. На отдельные части оружия нанесли водостойкую краску красного цвета, черные узоры паутины и слой полуглянца. Внимательно смотри, куда идешь, ведь никогда не знаешь, где можно угодить в паутину', 1, 6, 1, 'https://cdn.csgo.com/item_520107289_188530139.png', 599, 599, 1, 1),
(169, 'M4A1-S | Падение Икара', 'Коллекция «Боги и чудовища»', '\r\nБесшумный карабин M4A1 оснащен менее вместительным магазином, чем его аналог без глушителя, зато он обеспечивает более тихую стрельбу с меньшей отдачей и повышенной точностью. С помощью аквапечати нанесен узор в виде перьев и тающего под Солнцем воска. «В предательстве Тернера виноват я… Мне это исправлять», — Себастьен Энке, снайпер\r\n', 1, 4, 1, 'https://cdn.csgo.com/item_992128244_480085569.png', 599, 599, 1, 0),
(170, '★ Керамбит | Кровавая паутина', 'Без колекции', 'Тайное ★\r\nКерамбит — это нож с изогнутым лезвием, имитирующим клык тигра, специально разработанный для юго-восточного азиатского боевого искусства силат. Нож обычно держат обратной хваткой, вдевая указательный палец в кольцо на рукоятке. На отдельные части оружия нанесли водостойкую краску красного цвета, черные узоры паутины и слой полуглянца. Внимательно смотри, куда идешь, ведь никогда не знаешь, где можно угодить в паутину', 1, 6, 1, 'https://cdn.csgo.com/item_312713307_188530139.png', 1699, 1699, 1, 0),
(171, '★ Штык-нож M9 | Doppler', 'Без колекции', '\r\nЭто штык от М-9. Первоначально предназначался для установки на винтовке, но отлично подходит и для ближнего боя. Окрашено черной и серебряной металлической краской под мрамор, а затем нанесен градиент. Чрезмерно усердное разглядывание приводит к летальному исходу', 1, 6, 1, 'https://cdn.csgo.com/item_720469187_188530139.png', 1699, 1699, 1, 0),
(172, '★ Складной нож | Marble Fade', 'Без коллекции', 'Спортивные складные ножи персидского стиля со стреловидным лезвием и очень острой заточкой. В то время как лезвие может быть хрупким, сам складной нож удивительно прочный. Окрашено черной и серебряной металлической краской под мрамор, а затем нанесен трехцветный градиент. На лезвии много цветов, но вскоре останется лишь цвет крови\r\n', 1, 6, 1, 'https://cdn.csgo.com/item_720540811_188530139.png', 1399, 1399, 1, 0),
(173, '★ Нож с лезвием-крюком | Убийство', 'Без коллекции', 'Наиболее примечательной особенностью ножа-потрошителя является крюк для потрошения на тыльной стороне лезвия. Первоначально применявшийся как вспомогательное средство для свежевания животных, он также эффективен в прорезании волокнистых материалов, таких как веревки, стропы или ремни безопасности. Был покрашен в полоску красками с алюминиевым и хромовым отблеском, а потом покрыт томатно-красным цветом. Валерия платила Хавьеру не за то, чтобы тот задавал вопросы… а за то, чтобы он выбивал ответы', 1, 6, 1, 'https://cdn.csgo.com/item_314058381_188530139.png', 699, 699, 1, 1),
(174, 'Glock-18 | Градиент', 'Коллекция «Assault»', 'Пистолет Glock 18 подходит для первого раунда. Он наиболее эффективен против противников без бронежилета и позволяет вести огонь сериями из трех выстрелов. Покрытую хромом основу с помощью баллончика покрасили в полупрозрачные цвета, которые плавно переходят друг в друга. «Это не только оружие, но и предмет обсуждения», — Имоген, начинающий торговец оружием', 1, 4, 1, 'https://cdn.csgo.com/item_310781313_0.png', 1499, 1499, 1, 0);
